import React from 'react';
import './Count.css';
import { IoIosPeople } from "react-icons/io";
import { TweenMax, Expo } from 'gsap';


// Return people component
export default function RetuRnCount() {

 React.useEffect(() => {

  TweenMax.from('.wrp-count div', 1, { delay: 1.2, opacity: 0, y: 30, ease: Expo.ease })

 }, []);


 return (
  <div className='wrp-count'>
   <div><IoIosPeople size={'7vw'} /></div>
   <span>{'+12 405 984 '}</span>
   <p>Membres avec nous.</p>
  </div>
 );
}
